import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ColabWorks = () => {
    const [colabWorks, setColabWorks] = useState([]);

    useEffect(() => {
        const fetchColabWorks = async () => {
            try {
                const response = await axios.get('http://localhost:3001/getColabWorks');
                setColabWorks(response.data);
            } catch (err) {
                console.error(err);
            }
        };

        fetchColabWorks();
    }, []);

    return (
        <div>
            {colabWorks.map(work => (
                <div key={work._id}>
                    <h3>{work.title}</h3>
                    <p>{work.description}</p>
                    <img src={`http://localhost:3001/getColabWorks/${work._id}`} alt={work.title} />
                </div>
            ))}
        </div>
    );
};

export default ColabWorks;
